?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Компания появилась на свет в 1996 году благодаря часовщику Клаусу Якобу. Во время одной из своих поездок в Швейцарию ему попались старинные мануфактурные калибры, что и стало одной из отправных точек в его часовой деятельность (в будущем, именно эти калибры будут использованы при создании часов Jacques Etoile). Создатель этой компании известен как мастер в обновлении Venus 175. Интересно, что для создания своих часов, Клаус Якоб использует Калибр 6300, который давно был снят с производства. Одна из коллекций, оснащенная этим механизмом, была выпущена в 1996 году. Стоит отметить, что коллекция насчитывала всего лишь 300 экземпляров. А вот в 2006 году, Клаус выпускает несколько коллекций, которые работали на механизме Bidynator 42, потрясший в 1942 году все часовое общество. Но, по настоящему популярной, компания Jacques Etoile стала после выставки 2006 года, проведенной в Швейцарии. Клаус Якоб представляет хронограф, который был оснащен ETA 7750. Корпус изготовлен из нержавеющей стали, ремешок из кожи аллигатора, а стекло произведено из толстого сапфира. Кроме того, этот хронограф водонепроницаем до 100 метров. Через 1,5 года Клаус Якоб выпускает коллекцию под названием «Lune Etoile». На циферблатах часов из этой коллекции изображены знаки зодиака, и это означает то, что абсолютно каждый человек может приобрести эти часы в соответствии со своим знаком зодиака. Ассортимент компании начинается с классического, а заканчивается спортивным стилем. Часы Jacques Etoile это часы для тех людей, которые предпочитают классический дизайн, и при этом, хотят подчеркнуть свою индивидуальность.</span></span></p>
 
